// Teorie.jsx
import React from 'react';
import { useNavigate } from 'react-router-dom';

function Teorie() {
    const navigate = useNavigate();

    const handleButtonClick = (buttonNumber) => {
        navigate(`/teorie/${buttonNumber}`);
    };

    return (
       
        <div className="flex flex-col items-center justify-center border text-center rounded" style={{width:'20%'}}>
        {Array.from({ length: 20 }, (_, index) => (
            <button 
                key={index} 
                onClick={() => handleButtonClick(index + 1)}
                className="w-full my-2 px-4 py-1 rounded bg-blue-500 text-white hover:bg-blue-700 focus:outline-none ml-5"
            >
                Buton {index + 1}
            </button>
        ))}
    </div>
    
    
    );
}

export default Teorie;
